import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div id="root">
      <input type="text" id="searchInput"></input>
      <button onclick="search(document.getElementById('searchInput').value)">Search</button>
    </div>
  );
}

function search(input) {
  var myQuery = encodeURI(input)
  window.location.assign("https://www.google.com/search?q=" + myQuery);
}

export default App;
